import Proveedores from "../models/Proveedores";

export const renderProductosEdit = async(req,res)=>{
    const products = await Product.find().lean();
    //console.log(tasks[0]);
    res.render("index",{products, nombre: "Lista de productos"});
}


export const createProveedor = async (req, res) => {
    try {
        const proveedor = new Proveedores(req.body); 
        const proveedorSaved = await proveedor.save();
        console.log(proveedorSaved);
        res.redirect('/proveedores');
    } catch (error) {
        console.log(error);
        res.status(500).send("Error al crear el proveedor."); 
    }
}

export const aboutProveedor = (req, res) => {
    res.render("about");
}

export const renderProveedortEdit = async (req, res) => {
    const cliente = await Proveedores.findById(req.params.id).lean();
    res.render("editprov", { proveedor });
}

export const editProveedor = async (req, res) => {
    const { id } = req.params;

    try {
        await Proveedores.findByIdAndUpdate(id, req.body);
        res.redirect('/proveedores');
    } catch (error) {
        console.error(error);
        res.status(500).send('Error al actualizar el cliente');
    }
};


export const deleteProveedor = async (req, res) => {
    const { id } = req.params;
    await Proveedores.findByIdAndDelete(id);
    res.redirect('/proveedores'); 
}

