// src/passport/local-auth.js
import User from '../models/User'; // Asegúrate de que esta ruta sea correcta
import passport from 'passport';
import LocalStrategy from 'passport-local';

// Función de inicialización de Passport
export const initPassport = () => {
  passport.use(new LocalStrategy(
    async (username, password, done) => {
      try {
        const user = await User.findOne({ email: username });
        if (!user) {
          return done(null, false, { message: 'Usuario no encontrado' });
        }
        // Asegúrate de verificar la contraseña correctamente
        const isMatch = await user.comparePassword(password); // Implementa este método en tu modelo User
        if (!isMatch) {
          return done(null, false, { message: 'Contraseña incorrecta' });
        }
        return done(null, user);
      } catch (error) {
        return done(error);
      }
    }
  ));

  passport.serializeUser((user, done) => {
    done(null, user.id);
  });

  passport.deserializeUser(async (id, done) => {
    const user = await User.findById(id);
    done(null, user);
  });
};

