import passport from 'passport';
import LocalStrategy from 'passport-local';
import User from '../models/User'; // Asegúrate de que la ruta sea correcta

passport.use(new LocalStrategy({
  usernameField: 'email' // Cambia esto si estás usando un campo diferente
}, async (email, password, done) => {
  try {
    const user = await User.findOne({ email });
    if (!user) {
      return done(null, false, { message: 'Usuario no encontrado' });
    }
    const isMatch = await user.matchPassword(password); // Asegúrate de tener este método en tu modelo
    if (!isMatch) {
      return done(null, false, { message: 'Contraseña incorrecta' });
    }
    return done(null, user);
  } catch (error) {
    return done(error);
  }
}));

passport.serializeUser((user, done) => {
  done(null, user.id);
});

passport.deserializeUser(async (id, done) => {
  const user = await User.findById(id);
  done(null, user);
});

